import React from 'react'
import { useNavigate } from 'react-router-dom'
import { createUserData } from "../firebase";
import Swal from 'sweetalert2'
import withReactContent from 'sweetalert2-react-content'
const MySwal = withReactContent(Swal);
export default function Cargar({ user, setUser }){
    const navigate = useNavigate()
    const handleChange = ({target: {name, value}}) => {
        setUser({...user, [name]: value});
    };
    function calculoDeEdad(BirthDate) {
        let hoy = new Date();
        console.log(hoy)
        let cumpleanios = new Date(BirthDate);
        console.log(BirthDate)
        let edad = hoy.getFullYear() - cumpleanios.getFullYear();
        let m = hoy.getMonth() - cumpleanios.getMonth();
        if (m < 0 || (m === 0 && hoy.getDate() < cumpleanios.getDate())) {
            edad--;
        }
        console.log(edad);
        return edad;
    }
    const store= async (e) => { //funcion para almacenar
        e.preventDefault()
        await createUserData(user);
        if(((calculoDeEdad(user.BirthDate) > 60) && (user.doseAmountCovid < 2)) || user.riskFactor){
            MySwal.fire("Se le asigno un turno automaticamente");
        }else{
            MySwal.fire("Se le notifico a los administradores su solicitud de turno");
        }
        navigate('/')
    }
    return (
      <div className='container'>
          <div className='row'>
              <div className='col'>
                  <h1> Datos Importantes </h1>
                  <form onSubmit={store}>
                  <div className='mb-3'>
                          <label htmlFor="zone" className='form-label'>Vacunatorio</label>
                          <input type="text" name="zone" placeholder="Municipalidad" className='form-control' onChange={handleChange} required/>    
                      </div>
                      <div className='mb-3'>
                          <label className='form-label' htmlFor="riskFactor">¿Sos una persona con factores de riesgo?</label>
                          <input type="radio" name="riskFactor" className='form-control' onChange={handleChange} required/> Si
                          <input type="radio" name="riskFactor" className='form-control' onChange={handleChange} required/> No 
                      </div>
                      <h1> Datos Vacuna COVID-19 </h1>
                      <div className='mb-3'>
                          <label className='form-label' htmlFor="doseAmountCovid">Cantidad de dosis de COVID-19 recibidas</label>
                          <input type="number" name="doseAmountCovid" className='form-control' onChange={handleChange} required min={0} max={2}/>    
                      </div>
                      <h1> Datos Vacuna GRIPE </h1>
                      <div className='mb-3'>
                          <label className='form-label' htmlFor="hasVaccineFlu">¿Posee la vacuna para la gripe?</label>
                          <input type="radio" name="hasVaccineFlu" className='form-control' onChange={handleChange} required/> Si
                          <input type="radio" name="hasVaccineFlu" className='form-control' onChange={handleChange} required/> No
                      </div>
                      <div className='mb-3'>
                          <label className='form-label' htmlFor="vaccinationDateFlu">¿En qué fecha se la dió?</label>
                          <input type="date" name="vaccinationDateFlu" className='form-control' onChange={handleChange} required />    
                      </div> 
                      <h1> Datos Vacuna FIEBRE AMARILLA </h1>
                      <div className='mb-3'>
                          <label className='form-label' HTMLFor="hasYellowFever">¿Tiene la vacuna de la fiebre amarilla?</label>
                          <input type="radio" name="hasYellowFever" className='form-control' onChange={handleChange} required/> Si 
                          <input type="radio" name="hasYellowFever" className='form-control' onChange={handleChange} required/> No
                      </div>
                      <div className='mb-3'>
                          <label className='form-label' HTMLFor="doseYearYellowFever">Año en que se la aplicó</label>
                          <input type="number" name="doseYearYellowFever" className='form-control' onChange={handleChange} required min={1900} max={2022}/>    
                      </div>
                      <button type='submit' className='btn btn-primary'>guarda los datos pa</button>
                  </form>
              </div>
          </div>
      </div>
    )
}
